    .get(widgetContext.servicesMap.get("entityService"))
    .getEntity(entityId.entityType, entityId.id)
    .subscribe(updateDashboardState);

function updateDashboardState(entity) {
    const entitySubType = entity.type;
    const stateId = DecoderMappingModule.DecoderMappings[
        entitySubType];

    if (!stateId) return;

    const params = {
        entityId,
        entityName,
        entityLabel
    };
    widgetContext.stateController.updateState(stateId,
        params, false);
}

